import React,{useState,UseE} from 'react'
import '../CSS/Work.css'
import Background from '../Assets/app-dev.jpg'
import axios from 'axios'
function WorkPage() {

    var myArray = ["one", "Two", "Three", "Four", "Five", "Six", "Seven", "Eight", "Nine",];
  
    function fetchData(){
        axios.get("http://localhost:5100/WorkList")
        .then(response =>{
           console.log(response.data);
        })
        .catch(error => {
            console.log(error);

        })
    }


    return (

        <div className="work-page">

            {myArray.map((item) => <div onClick={()=>fetchData()} className="items" style={{ backgroundImage: "url(" + Background + ")" }}></div>)}

        </div>


    )
}

export default WorkPage
